// @ts-nocheck
import React, { useState} from 'react';
import styles from './Hero.module.css';
const apples =[
  {name: 'granny smith'  , isSour: true , key: 1 },
  {name: 'gala' , isSour: false , key: 2 },
  {name: 'spartan' , isSour: false , key: 3 },
  {name: 'comsic crisp' , isSour: false , key: 4 }
]

function Hero (){
  const differentFruit = apples.map(a =>
    <li
    key={a.key}
    style={{color: a.isSour ? styles.sour : styles.non-sour}}
    >{a.name}</li>
    )
    return(
      <ul>differentFruit</ul>
    )
}




















export default Hero;
